import React, { useState } from 'react';
import Box from '@mui/material/Box';
import Slider from '@mui/material/Slider';
import Typography from '@mui/material/Typography';

const PercentageSlider = () => {
  const [value, setValue] = useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Box sx={{ width: '60%', margin: '0 auto', textAlign: 'center' }}>
      <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', marginBottom: '20px' }}>
        <Typography variant="h4" sx={{ marginRight: '10px' }}>
          {value}%
        </Typography>
        <img
          src="https://kairosrainbow.it/wp-content/uploads/2016/11/coins.png"
          alt="Coins"
          style={{ height: '30px' }}
        />
      </Box>
      <Slider
        value={value}
        onChange={handleChange}
        aria-labelledby="percentage-slider"
        min={0}
        max={100}
        step={5}
        shiftStep
        marks
        valueLabelDisplay="auto"
      />
    </Box>
  );
};

export default PercentageSlider;
